        "title": "SALCAPE Carbon Capture",
        "description": "The most effective CO2-capturing process for industrial flu gas.",
        "tagline": "The most effective CO2-capturing process for industrial flu gas.",
        "about": "Pitch\nCarbon dioxide emissions remain a problem in many industrial processes. Carbon Capture and Storage, is key to controlling industrial emissions. SALCAPE Carbon capture is a new CO2 removal technology is particularly relevant for industrial processes involving high-temperature flue gas, such as cement production, metal works, and energy production.\n\nUsing the well-known concept of calcium looping, we apply this concept in a patented process with molten salt as medium, achieving process characteristics superior to other CO2 removal processes.\n\nOur process is more efficient, is smaller in physical size, more economical, and requires less maintenance than alternative solutions available today. In addition, the process runs without any added chemicals, and with zero waste.",
