        "description": "Ride in Style",
        "tagline": "Ride in Style",
        "about": "Wheels is a last-mile, shared electric mobility platform changing the current landscape in dockless mobility. With innovative products focused on sleek design and safety, Wheels provides a low-cost, fun, and comfortable way to get around cities through the connection of a smartphone. Wheels is headquartered in West Hollywood, California, with plans to expand quickly across the world. Wheels was founded by brothers Joshua Viner and Jonathan Viner. Prior to Wheels Joshua and Jonathan founded the popular dog walking app Wag with the mission of creating the safest and most trusted platform to get your dog walked. They scaled to over 100 cities, raising almost $400 million in funding for Wag. Wheels also added former Bird, Uber and Lyft executives to it’s management team. The newest members include Ben Shaken who joined as Chief Product Officer from Lyft where he was Director of Product. Marco McCottry joined as Chief Operating Officer. Previously, McCottry served as an executive at Uber where he ran the Midwest business, and most recently led North American Operations for Bird.",
