        "recordId": "recNlJjV6B4hwVGso",
        "title": "Mainspring Energy",
        "description": "Advancing global access to low-carbon, dispatchable energy with a new category of power generation.",
        "tagline": "Advancing global access to low-carbon, dispatchable energy with a new category of power generation.",
        "about": "Mainspring’s linear generator uses a low-temperature reaction of air and fuel to drive magnets through copper coils to efficiently produce electricity. The patented design and adaptive control enable high efficiency, near-zero NOx emissions, full dispatchability, and seamless switching between renewable fuels such as biogas and nonrenewable fuels such as natural gas and propane.\n\nMainspring’s linear generator products combine grid-tie inverters and auxiliaries into turn-key packages for fast and simple installation. Mainspring’s first product is designed for commercial businesses with a rated output of 250 kW net AC (3-phase, 480 V) and packaged in a standard 20’ container. Future products designed for industrial businesses, data centers, hospitals, smart cities, and utilities will offer higher power output.\n\nMainspring (formerly EtaGen) was founded in 2010 by three Stanford engineers researching new technologies to improve the efficiency of distributed power generation. Since its founding, the company has successfully built and tested three generations of linear generators in preparation for commercial and industrial deployment. Mainspring will enter the market in 2020 with Fortune 100 customers and top-tier strategic partners.",
