        "recordId": "rec7RlqwrDOrwSJ5L",
        "title": "Vionx Energy",
        "description": " Durable...Renewable...Safe",
        "tagline": " Durable...Renewable...Safe",
        "about": "VIONX Energy has developed a grid-scale, long duration energy storage system delivering unmatched performance over a 20+ year life which is certified non-flammable, safe and bankable. The unique long-duration discharge of up to 10 hours at full rated power is enabled by its world leading flow battery stack technology operating at 3X higher power density than any competitor and proprietary vanadium electrolyte processing. \n\nThe VIONX system delivers unrivaled Levelized Cost of Storage at discharge durations greater than 4 hours due to low capital and operating cost and a product life of over 20 years with no performance degradation.\n\nThe VIONX VNX product family employs a modular architecture based on 1 MW power and 2 MWh energy building blocks that have been engineered to meet grid reliability standards and have undergone significant durability testing demonstrating up to 40 years of stack life.",
