        "about": "South Pole has delivered emissions reductions and renewable energy through more than 700 projects in over 40 countries to hundreds of organisations looking to compensate their carbon footprint, source clean power, and improve people's lives.\nBuy carbon credits from the world's largest portfolio of carbon projects to protect the planet and transform lives.\nCorporate demand for renewable energy procurement is growing as increasing numbers of investors, current and potential employees, and customers expect brands and businesses to implement substantial sustainability strategies. \n\nSouth Pole supports businesses and public bodies to improve their sustainability performance by offering a dynamic portfolio of sustainability consulting services. We combine customised advisory solutions with the ability to implement bold climate action worldwide. \n\nThe South Pole Digital Lab is our centre of excellence where we develop and scale digital solutions for better managing climate and natural resources challenges, as well as program web-based and mobile client applications. \n\nCorporates, governments and financial industry require dedicated investment opportunities and platforms where stakeholders can exchange solutions for positive impact if we are to achieve the Sustainable Development Goals (SDGs) and limit the global temperature rise. ",
