        "description": "Solar Safe Water Heater",
        "tagline": "Solar Safe Water Heater",
        "about": "SOLVATTEN is a combined portable water treatment and solar water heater system that has been designed for use at the household level in the developing world. The device uses natural UV radiation to treat water, and units are capable of rendering highly contaminated water drinkable as defined by the WHO safe drinking water standards. \n\nSOLVATTEN incorporates three water treatment processes: filtration, Pasteurization and UV sterilisation. Under optimal conditions, the device can eliminate all pathogenic material in 10-liters of water within 2 hours, allowing for up to 4 batches of water to be treated in a day.\n\nThe device is typically used in situations where water resources are scarce and prone to contamination, but it has also been applied in disaster relief scenarios. ",
