        "recordId": "recc6lgyEsUa7do0j",
        "title": "FOX-TECH Co.",
        "description": "FOX-TECH CO. provides IoT solution to help business optimize their operations, increase safety and quality through data analytics on the go.",
        "tagline": "FOX-TECH CO. provides IoT solution to help business optimize their operations, increase safety and quality through data analytics on the go.",
        "about": "FOX-TECH Co. enables farming, logistics, cold chain, and manufacturing owners to monitor, track, and improve their operation by our data analytics IoT Platform. FOX- TECH combines secure, low power consumption, efficient data structure, and high sensor accuracy devices with its cutting-edge platform to simplify IoT for everyone. FOX-TECH is empowering business owners to have the required temperature and humidity changes alerts when it’s needed, while also providing a global coverage for monitoring.\n\nFOX-TECH’s flagship product (TEMPHAWK) has helped business owners reduce their margin loss across the food supply chain in over 24 countries worldwide in the last 18 months.",
