        "about": "Shoreline is an enterprise SaaS provider of intelligent simulation and optimization solutions for project development and field operations management for wind energy assets. Powered by state of the art simulation technology with a built-in artificial intelligence engine, Shoreline software simulates an endless number of complex supply chain, field service, workflow, and asset performance scenarios with speed and precision to find the optimal scenario. \n\nDecision-makers can use our Design solution for scenario analysis during project development and our Execution solutions for construction and maintenance work scheduling, resource management, and reporting, reducing risk and achieving safer, more cost-efficient operations and increased production. \n\nShoreline has been deployed by several of the world's largest energy and power companies across assets in Europe, US, and Asia with an initial focus on wind and strong applications across all energy verticals requiring complex scenario planning.",
