        "description": "Rho Motion provides long-term forecasts and analysis of Electric Vehicle battery pack size, chemistry and costs",
        "tagline": "Rho Motion provides long-term forecasts and analysis of Electric Vehicle battery pack size, chemistry and costs",
        "about": "Rho Motion offers the most comprehensive and well-informed forecast and analysis for the Electric Vehicle industry, linking battery pack to Electric Vehicle platform. Our rigorous analysis interrogates each point in the Electric Vehicle supply chain. We consider the implications of government legislation and incentives, OEM and battery manufacturer strategy, in addition to raw material, technology and infrastructure costs, capital investment and consumer behaviour.\n\nOur core monthly and quarterly assessments and outlook provide ongoing analysis of the development of Electric Vehicle battery pack sizes, energy density, chemistry and costs, as well as the rate of growth of the Electric Vehicle market by vehicle class. \n\nBased in London, our team has expertise in vehicle markets and economics, the battery supply chain and its raw materials, as well as the impact of government legislation on OEM technology choices.",
