        "recordId": "rec7OW6NS00YYdlvf",
        "title": "Redflow",
        "description": "Sustainable energy storage",
        "tagline": "Sustainable energy storage",
        "about": "Redflow\n  Limited, a publicly-listed Australian company (ASX: RFX), produces small\n  10kWh zinc-bromine flow batteries that tolerate daily hard work in harsh\n  conditions. Marketed as ZCell and ZBM2, Redflow batteries are designed for\n  high cycle-rate, long time-base stationary energy storage applications in the\n  residential, commercial & industrial and telecommunications sectors, and\n  are scalable from a single battery installation through to grid-scale\n  deployments. Redflow batteries are sold, installed and maintained by an\n  international network of energy system integrators. Redflow’s smart,\n  self-protecting batteries offer unique advantages including secure remote\n  management, 100 per cent daily depth of discharge, tolerance of high ambient\n  temperatures, a simple recycling path, no propensity for thermal runaway and\n  sustained energy delivery throughout their operating life.",
