        "title": "Pyropower",
        "description": "We built and implement carbon negative energy technologies in rural, smart-cities and coastal applications in the form of decentralised waste-to-energy. ",
        "tagline": "We built and implement carbon negative energy technologies in rural, smart-cities and coastal applications in the form of decentralised waste-to-energy. ",
        "about": "At Pyropower, we believe in a future where energy no longer divides, destroys and depletes. We envision a future where energy is available to everyone irrespective of their caste, nationality or financial state while sustaining nature altogether. The power of global knowledge and milieu is our greatest gift today. That is why Pyropower aims to reach as many regions and communities as there are energy and environmental problems to solve.\n\nThe bottleneck is not just understanding, but allocating the time and resources towards designing a culture plan, implementing it and then maintaining it while scaling up. We are a team of dreamers with different nationalities, backgrounds and perspectives, but we chase the same dream of a clean, sustainable and abundant future.",
