        "title": "OrganoClick",
        "description": "OrganoClick is manufacturing and supplying a range of unique environmentally friendly biomaterials and chemical compositions.",
        "tagline": "OrganoClick is manufacturing and supplying a range of unique environmentally friendly biomaterials and chemical compositions.",
        "about": "OrganoClick AB (publ) is a Swedish cleantech company listed on Nasdaq First North that develops, produces and markets functional materials based on environmentally friendly fiber chemistry. Examples of products that are marketed by OrganoClick are the water repellent fabric treatment OrganoTex®, the flame and rot timber protectant OrganoWood® (through the subsidiary company OrganoWood AB) and biobased binders for non-woven materials.OrganoClick was founded in 2006 as a commercial spinoff company based on academic research examining the modification of biofibers performed at Stockholm University and the Swedish University of Agricultural Sciences. OrganoClick has won several prizes and has been designated “Sweden's most promising start-up company”, Sweden's best environmental innovation and has appeared on the Affärsvärldens och NyTekniks top 33 list of “Sweden's hottest technology companies”. The company has also received a number of awards, such as The Worldwide Fund for Nature (WWF) “Climate Solver” award. OrganoClick’s headquarters are in Täby, north of Stockholm, where the company's production, R&D, sales and marketing departments are located. OrganoClick's Certified Adviser on Nasdaq First North is Erik Penser Bank.",
