        "about": "Our app calculates two metrics, called Quantified Carbon Dioxide (QCD) and Quantified Avoided Carbon (QAC) from your smartphone movement. QCD provides valuable baseline information, which we anonymize, aggregate, and analyze to improve climate change models and calculations.\nEach time you bike, walk or take mass transit CODEX calculates the QAC as a result of your actions.\n\nLets say you drive to work on Mondays, and then bike and take public transit the rest of the week. Each day, CODEX automatically senses your mode of transport, calculates your emissions, and generates carbon offsets whenever you choose to use low carbon transport. As your QCD decreases, our app calculates and attributes the resulting QAC to you.",
