        "description": "The world’s leading manufacturer of transparent photovoltaic (PV) glass for buildings",
        "tagline": "The world’s leading manufacturer of transparent photovoltaic (PV) glass for buildings",
        "about": "Onyx Solar uses PV Glass as a material for building purposes as well as an electricity-generating material, with the aim of capturing the sunlight and turn it into electricity. The panes are made of layers of heat-treated safety glass which can provide the same thermal and sound insulation as conventional architectural glass, not to mention the fact that they also let natural light go through in the same way as conventional glass.Thus the PV glass panes could be installed replacing conventional glass on building facades, curtain walls, atriums, canopies and terrace floors, among other architectural applications.These glass panes could additionally be installed on a wide variety of existing buildings and facilities, therefore contributing to their enhacement both from an aesthetic and energetic point of view.\n\n \n\nBy providing the same thermal insulation as conventional glass, along with the capacity to generate free clean electricity from the sun, it enables buildings to drastically improve their energy efficiency, decrease operation and maintenance costs, and reduce their carbon footprint.",
