        "recordId": "recGi18qEkmeIU3yo",
        "title": "Nature Coatings",
        "description": "Nature Coatings transforms wood waste into high performing black pigments.",
        "tagline": "Nature Coatings transforms wood waste into high performing black pigments.",
        "about": "Nature Coatings transforms wood waste into high performing black pigments. The wood waste is sourced from sustainable FSC certified forests. Our manufacturing process is closed-loop and a circular system. No external energy is required to run the equipment, and our process does not emit any CO2 or other greenhouse gases. Nature Coatings’ pigments are designed for industry. They are cost competitive. They are easy to use with existing equipment and water based formulas and do not require any upfront capital expenditure. Additionally, they stay far ahead of any global restricted substance lists, known as RSLs. Our pigments do not fade in the sun and do not “bronze” or turn brown at high or low concentrations. Our pigments are suitable for multiple applications including, but not limited to, screen printing, rotary printing, digital inkjet printing, coatings, dope dye, airbrush, resin casting and wood coloring.\n",
