        "about": "Katapult is a system that invests in and mobilizes capital into businesses created to solve the world’s grand challenges - providing value to people and the planet and giving a superior return on investments. The Katapult business units are designed to maximize internal synergies and share intellectual capital and expertise. Together we accelerate and deepen the collective impact and financial performance of the Group. Katapult is dedicated to building the field of impact investing by educating, convening, and enabling private capital owners to invest in impact tech startups and supporting the entrepreneurs building these.\nKatapult Climate is taking on the massive opportunity of investing in and supporting brilliant impact tech startups that are building solutions to solve the major challenges related to the climate crisis. \nWe invest and support impact tech climate startups, funds and projects, with a mission to solve the highlighted SDGs (7, 9, 11, 12, 13 & 15 - and some in 17). We are creating a movement that other investors are following. We lead by example. We drive many initiatives that build the impact investing field and attract new capital; including numerous events both in our main area of influence in the Nordics and further afield across the globe. We are working on catalyzing HNWI, family offices and foundation capital into impact investing by both giving them opportunities to co-invest and by offering support and education.",
