        "description": "Enabling the transition to a cleaner, more reliable electricity grid.",
        "tagline": "Enabling the transition to a cleaner, more reliable electricity grid.",
        "about": "Hydrostor's Advanced Compressed Air Energy Storage (A-CAES) technology delivers low-cost, long duration bulk energy storage. Hydrostor's technology operates very similarly to a gas plant but is entirely non-emitting, is much more cost-effective than batteries at scale with a 50+-year asset life, and is suited to providing long-duration storage necessary for decarbonizing the grid. Hydrostor has three projects in operation in Canada and Australia, and numerous utility-scale projects ranging in capacity from 20 – 500 MW and duration from 4 to 24 hours, in various development stages across the USA, Canada, Chile and Australia.",
