        "recordId": "recyVQqdkf8ZRGy6L",
        "title": "Climate Visuals",
        "description": "The world's only evidence-based climate change photography resource",
        "tagline": "The world's only evidence-based climate change photography resource",
        "about": "Climate change has an image problem.\nThe images that define climate change shape the way it is understood and acted upon.\nBut polar bears, melting ice and arrays of smoke stacks don’t convey the urgent human stories at the heart of the issue.\nBased on international social research, Climate Visuals provides seven principles for a more diverse, relatable and compelling visual language for climate change.\nThis website contains a growing library of photographs to provide inspiration and guidance for campaigners, picture editors and communications practitioners selecting imagery for communicating climate change. \nClimate Visuals expertise and insights can also be accessed through our photography and visual services, bespoke partnerships and consultancy.  ",
