        "title": "Climate Reality",
        "description": "At Climate Reality, we’re here to make urgent action a necessity. In politics. In business. In every aspect of our lives. Everywhere.",
        "tagline": "At Climate Reality, we’re here to make urgent action a necessity. In politics. In business. In every aspect of our lives. Everywhere.",
