        "about": "Our purpose is to increase the capacity and capability of climate-vulnerable country negotiators to engage in international climate negotiations, helping to preserve and enhance the rules-based international system and increase appetite for higher ambition.\nOur vision is for a fairer, more inclusive negotiation process that enables the meaningful participation of climate-vulnerable country negotiators, supporting the ambition to keep global warming to less than 1.5 degrees celsius and reducing the prospects of rapidly escalating climate extremes and severe risks for vulnerable people and systems.",
