        "title": "Boston Metal",
        "description": "Metals made better",
        "tagline": "Metals made better",
        "about": "Boston Metal is a global metals technology solutions company that is commercializing Molten Oxide Electrolysis (MOE), a patented tonnage metals production platform. MOE provides the metals industry with a more efficient, lower cost, and greener solution for the production of a wide variety of metals and alloys from a wide variety of feedstocks. Boston Metal works closely with customers to tailor the MOE technology for specific alloys, feedstocks, and business needs.\n\nToday, the steel industry is the largest industrial source of CO2 emissions because of a reliance on coal. Boston Metal removes coal from the process, driving CO2 emissions to zero and providing substantial OPEX and CAPEX savings.\n\nBoston Metal’s headquarters and industrial development center are located in Woburn, MA, USA. Boston Metal is supported by world-class investors, including Breakthrough Energy Ventures, OGCI Climate Investments, Prelude Ventures, and The Engine.",
