        "description": "Meeting grid challenges and delivering reliability.",
        "tagline": "Meeting grid challenges and delivering reliability.",
        "about": "At Beacon Power we are committed to providing utilities and system operators the best flywheel-based energy storage resources to help maintain a reliable, cost-effective and stable power grid. Beacon Power is the global leader in the development and commercialization of fast response flywheel-based energy storage systems, offering proven solutions at the utility-scale for power grid efficiency, frequency regulation, grid reliability, renewable power integration and other ancillary services. Beacon currently operates three commercial flywheel plants ranging in capacity up to 20 MW in three different U.S. markets and our flywheel system has delivered over 7 million operating hours. Our patented flywheel systems are modular and can be configured to meet the power capacity demands of a variety of applications, from 100 kW to multi-MW systems. The company’s headquarters and manufacturing facility are in Tyngsboro, Massachusetts.",
