        "title": "10X Beta",
        "description": "Making a shoe out of thin air.",
        "tagline": "Making a shoe out of thin air.",
        "about": "The world must find a way to capture CO₂ emissions and turn them into valuable resources. Together with NRG and partners, we designed, developed, and fabricated the first  “shoe without a footprint” for the launch of COSIA’s Carbon XPRIZE.\n\nThe Carbon XPRIZE is a $20 Million global competition hosted by NRG to inspire the development of breakthrough technologies that convert CO₂ emissions into valuable assets like building materials, alternative fuels, and consumer products we use every day.\n\nTo kick off the competition, 10XBeta was commissioned to create a sneaker that showcased how consumer products could benefit from the use of recycled CO₂ at the object, system, and materials level. The process required extensive material science and biochemistry research, as well as support from partners in shoe and fashion design, sourcing, and manufacturing.",
